import ReactStars from "react-rating-stars-component";
import React, { useEffect, useState } from 'react'
import { Button, Card } from 'react-bootstrap';
import Header from './Header';
import './Products.css';
import './components/Topbar/bootstrap.min.css';




const Products = () => {
  const ratingChanged = (newRating) => {
    console.log(newRating);
  };
  return (
    <Header title='Products'>


      <Card className="text-center">
        <Card.Header><h1>Name</h1></Card.Header>
        <Card.Body>

          <Card.Text style={{ marginBottom: 20 }}>
            Description

            <Card.Img variant="bottom" src="holder.js/100px180" />

          </Card.Text>

          <Button variant="primary" >Prev</Button>
          <Button variant="primary" >Delete</Button>
          <Button variant="primary" >Next</Button>
<ReactStars 
              align="center"
              count={5}
              onChange={ratingChanged}
              size={30}
              activeColor="#2045B6"
  /> 
            <input name='comment' className='input0' type='text' placeholder='review' />
            <Button variant="primary" >Submit</Button>
        </Card.Body>

      </Card>

      <Card className="text-center">
        <Card.Header>
          <h1>Add new pruduct</h1>

        </Card.Header>
        <Card.Body>

          <Card.Text >


            <textarea name='product' className='input0' type='text' placeholder='Products name' required />
            <br /><br />


            <textarea name='description' className='input' type='text' placeholder='Description' required />

            <br />
            <input name='img' type='file' style={{ padding: 20 }}></input>
          </Card.Text>
          <Button type="button">Add</Button>



        </Card.Body>

      </Card>
    </Header>



  );
}

export default Products
